-- merge UserWealthLog sub-table into total table
set names 'utf8';
use haodou_center;
-- alter table haodou_center.UserWealthLog disable keys where `CreateTime` > @maxtime;
-- truncate haodou_center.UserWealthLog where `CreateTime` > @maxtime;
select max(`CreateTime`) into @maxtime from haodou_center.UserWealthLog;
